{

    int n = 1 << nbits;

    int ret;



    s->nbits           = nbits;

    s->inverse         = trans == IDFT_C2R || trans == DFT_C2R;

    s->sign_convention = trans == IDFT_R2C || trans == DFT_C2R ? 1 : -1;



    if (nbits < 4 || nbits > 16)

